<script>
document.addEventListener("DOMContentLoaded", function() {
    const resumeParentDiv = document.querySelector('.custom-hover-resume-parent-div');
    const resumeSvgPath = document.querySelector('.custom-hover-resume-parent-div #N3jzRoi040rsHhAN path');
    const resumeText = document.querySelector('.custom-hover-resume-parent-div #fWWoUu0GvZOzyDdY');

    const contactParentDiv = document.querySelector('.custom-hover-contact-parent-div');
    const contactSvgPath = document.querySelector('.custom-hover-contact-parent-div #AQsPAAL3f1IqM25F path');
    const contactText = document.querySelector('.custom-hover-contact-parent-div #OhKmhZ9XPKb2et6K');

    const hoverColor = '#ff9900';
    const originalSvgFillColor = resumeSvgPath.getAttribute('style').split('fill:')[1].split(';')[0].trim();
    const originalTextColor = resumeText.getAttribute('style').split('color:')[1].split(';')[0].trim();

    function applyHover(svgPath, textElement) {
        svgPath.setAttribute('style', 'fill:' + hoverColor + ' !important');
        textElement.setAttribute('style', 'color:' + hoverColor + ' !important');
    }

    function removeHover(svgPath, textElement) {
        svgPath.setAttribute('style', 'fill:' + originalSvgFillColor + ' !important');
        textElement.setAttribute('style', 'color:' + originalTextColor + ' !important');
    }

    resumeParentDiv.addEventListener('mouseover', () => applyHover(resumeSvgPath, resumeText));
    resumeParentDiv.addEventListener('mouseout', () => removeHover(resumeSvgPath, resumeText));

    contactParentDiv.addEventListener('mouseover', () => applyHover(contactSvgPath, contactText));
    contactParentDiv.addEventListener('mouseout', () => removeHover(contactSvgPath, contactText));
});
</script>
